import axios from "axios";
var cors = require('cors')



class TodoDataService{
    retrieveAllTodos(name){
        return axios.get(`http://localhost:8080/users/${name}/todos`) //using the tick character here on purpose so we can access var
    }



    deleteTodo(username,id){
        return axios.delete(`http://localhost:8080/users/${username}/todos/${id}`) //using the tick character here on purpose so we can access var

    }


}

export default new TodoDataService();
